import React, {
    Component
} from "react";

export default class List extends Component {
    state = {
        list: [1,2,3],

    };
    render(){
        return (
            <div>
                {
                    this.state.list.map(item => {
                        return <li>{item}</li>
                    })
                }
            </div>
        )
    }
}
